import { Storage } from "../infrastructure/Storage";
import {
  InvlalidSessionTokenError,
  UnauthorizedError,
  UsersRepository,
} from "../infrastructure/repositories";
import { UserItem } from "../models/presentation/UserItem";

export class FetchUsersInput {}

export class FetchUsersOutput {
  readonly users: UserItem[];

  constructor(params: { users: UserItem[] }) {
    this.users = params.users;
  }
}

export class FetchUsersUsecase {
  async fetch(): Promise<FetchUsersOutput> {
    const sessionToken = Storage.restoreSessionToken();
    if (!sessionToken) {
      throw new InvlalidSessionTokenError();
    }

    const usersRepository = new UsersRepository();

    try {
      const usersData = await usersRepository.fetch(sessionToken);
      console.log("Users data:", usersData);
      const usersList = usersData.map((user: any) => ({
        id: user.id,
        firstName: user.name.split(" ")[0],
        lastName: user.name.split(" ")[1] || "",
        attribute: user.status,
        email: user.email,
      }));
      console.log("Users list:", usersList);

      return new FetchUsersOutput({ users: usersList });
    } catch (error) {
      if (error instanceof UnauthorizedError) {
        Storage.clear();
      }
      console.error("Error in FetchUsersUsecase:", error);
      throw error;
    }
  }
}
